import React from 'react';

const Introduction = () => (
  <div className="container text-center d-flex flex-row justify-content-between">
    <div>
      <h1>Introduction</h1>
      <p>Hi, I'm Ahmed Afraz. I'm a software engineering student at Air University. My ambition is to become a skilled full-stack developer.</p>
    </div>
    <img src={`${process.env.PUBLIC_URL}/Profile.jpg`} alt="Profile" className="img-fluid rounded-circle" style={{ width: '150px', height: '150px' }} />
  </div>
);

export default Introduction;
